"use strict";(self.webpackChunkdocs_s_1_nscripts_com=self.webpackChunkdocs_s_1_nscripts_com||[]).push([[1477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/tutorials/how-to-limit-fps-fivem","metadata":{"permalink":"/blog/tutorials/how-to-limit-fps-fivem","source":"@site/blog/2024-11-23-how-limit-fps-client.md","title":"How to Limit FPS in FiveM: Complete Guide (2024)","description":"Learn how to limit FPS in FiveM using Nvidia Control Panel and AMD Radeon settings. Step-by-step guide to optimize your game performance and reduce GPU strain.","date":"2024-11-23T00:00:00.000Z","formattedDate":"November 23, 2024","tags":[],"readingTime":3.115,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"How to Limit FPS in FiveM: Complete Guide (2024)","description":"Learn how to limit FPS in FiveM using Nvidia Control Panel and AMD Radeon settings. Step-by-step guide to optimize your game performance and reduce GPU strain.","keywords":["fivem fps limit","limit fps fivem","fivem fps cap","fivem nvidia settings","fivem amd settings","how to show fps fivem","fivem performance"],"slug":"/tutorials/how-to-limit-fps-fivem","sidebar_label":"Limit FPS in FiveM"},"unlisted":false,"nextItem":{"title":"FiveM: How to Clear Cache - Complete Guide (2024)","permalink":"/blog/tutorials/how-to-clear-fivem-cache"}},"content":"Looking to limit your FPS in FiveM? Whether you\'re using an NVIDIA or AMD graphics card, this guide will show you exactly how to cap your frame rate for optimal performance.\\n\\n## Why Limit FPS in FiveM?\\n- Reduce GPU strain\\n- Lower power consumption\\n- Prevent screen tearing\\n- Maintain stable performance\\n- Reduce input lag\\n\\n## Method 1: NVIDIA Control Panel Settings\\n\\n:::info Prerequisites\\nMake sure you have the latest NVIDIA drivers installed on your system.\\n:::\\n\\nFollow these steps to limit FPS using NVIDIA Control Panel:\\n\\n1. **Open NVIDIA Control Panel**\\n2. **Navigate to Settings**\\n    - Click \\"Manage 3D Settings\\"\\n    - Select \\"Program Settings\\" tab\\n    - Click \\"Add\\"\\n\\n3. **Locate FiveM Executable**\\n    - Click \\"Browse\\"\\n    - Navigate to: `%localappdata%\\\\FiveM\\\\FiveM.app\\\\data\\\\cache\\\\subprocess`\\n    - Select `FiveM_b2545_GTAProcess.exe` (or your current version)\\n\\n4. **Configure FPS Limit**\\n    - Find \\"Max Frame Rate\\" in the settings list\\n    - Set it to \\"On\\"\\n    - Input your desired FPS limit\\n    - Click \\"Apply\\"\\n\\n5. **Restart FiveM** to apply changes\\n\\n## Method 2: AMD Radeon Settings\\n\\n:::info Prerequisites\\nEnsure you have the latest AMD Radeon Software installed.\\n:::\\n\\nFor AMD graphics card users:\\n\\n1. **Open AMD Radeon Settings**\\n2. **Add FiveM**\\n    - Go to the \\"Gaming\\" tab\\n    - Click \\"Add a Game\\" in the top-right corner\\n    - Navigate to: `%localappdata%\\\\FiveM\\\\FiveM.app\\\\data\\\\cache\\\\subprocess`\\n    - Select `FiveM_b2545_GTAProcess.exe`\\n\\n3. **Configure Radeon Chill**\\n    - Select the FiveM profile\\n    - Scroll to find \\"Radeon Chill\\"\\n    - Enable the setting\\n    - Set your minimum and maximum FPS values\\n\\n4. **Apply Changes**\\n    - Save the profile\\n    - Restart FiveM\\n\\n## How to Display FPS in FiveM\\n\\nTo monitor your frame rate after applying limits:\\n\\n1. Open the console (Press F8)\\n2. Enter these commands:\\n   ```\\n   cl_drawFps 1\\n   cl_drawPerf 1\\n   ```\\n3. Press Enter\\n\\n:::tip Pro Tip\\nMonitoring your FPS helps verify if your frame rate limits are working correctly and helps identify performance issues.\\n:::\\n\\n## Recommended FPS Limits\\n\\nChoose your FPS limit based on your monitor\'s refresh rate:\\n\\n- **60Hz Monitor**: 60 FPS\\n- **144Hz Monitor**: 144 FPS\\n- **240Hz Monitor**: 240 FPS\\n\\n:::warning\\nSetting FPS limits higher than your monitor\'s refresh rate may cause unnecessary GPU load without visual benefits.\\n:::\\n\\n## Troubleshooting Common Issues\\n\\n### FPS Limit Not Working\\n1. Verify you selected the correct executable\\n2. Check if other FPS limiting software is running\\n3. Update graphics drivers\\n4. Restart your computer\\n\\n### Performance Issues After Limiting FPS\\n1. Try a higher FPS limit\\n2. Check for background processes\\n3. Verify game settings\\n4. Monitor GPU temperatures\\n\\n## Best Practices\\n\\n1. **Regular Updates**\\n    - Keep graphics drivers updated\\n    - Update FiveM regularly\\n    - Check for Windows updates\\n\\n2. **Performance Monitoring**\\n    - Use FiveM\'s built-in FPS display\\n    - Monitor GPU temperatures\\n    - Check resource usage\\n\\n3. **Optimal Settings**\\n    - Match FPS limit to monitor refresh rate\\n    - Balance between performance and quality\\n    - Consider your hardware capabilities\\n\\n## FAQs\\n\\n### What\'s the best FPS limit for FiveM?\\nThe optimal FPS limit depends on your monitor\'s refresh rate and hardware capabilities. Generally, matching your monitor\'s refresh rate is recommended.\\n\\n### Will limiting FPS reduce GPU temperature?\\nYes, capping your frame rate can significantly reduce GPU temperature and power consumption.\\n\\n### Does FPS limiting affect game performance?\\nWhen done correctly, FPS limiting can improve stability and reduce screen tearing without noticeable performance impact.\\n\\n### Why can\'t I find the FiveM executable?\\nMake sure you\'re looking in the correct subprocess folder and that FiveM has been run at least once to generate the necessary files.\\n\\n## Conclusion\\nLimiting FPS in FiveM is a straightforward process that can significantly improve your gaming experience. Whether you\'re using NVIDIA or AMD, following this guide will help you achieve optimal performance while reducing hardware strain.\\n\\n---\\n\\n**Last Updated**: November 2024  \\n**Author**: S1nScripts Documentation Team"},{"id":"/tutorials/how-to-clear-fivem-cache","metadata":{"permalink":"/blog/tutorials/how-to-clear-fivem-cache","source":"@site/blog/2024-11-23-how-to-clear-cache.md","title":"FiveM: How to Clear Cache - Complete Guide (2024)","description":"Learn the most effective methods to clear FiveM cache, fix common issues, and improve game performance. Step-by-step instructions for all cache clearing techniques.","date":"2024-11-23T00:00:00.000Z","formattedDate":"November 23, 2024","tags":[],"readingTime":3.12,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"FiveM: How to Clear Cache - Complete Guide (2024)","description":"Learn the most effective methods to clear FiveM cache, fix common issues, and improve game performance. Step-by-step instructions for all cache clearing techniques.","keywords":["fivem clear cache","how to clear fivem cache","fivem cache location","fivem cache fix","fivem loading problems","clear fivem data","fivem performance issues"],"slug":"/tutorials/how-to-clear-fivem-cache","sidebar_label":"Clear FiveM Cache"},"unlisted":false,"prevItem":{"title":"How to Limit FPS in FiveM: Complete Guide (2024)","permalink":"/blog/tutorials/how-to-limit-fps-fivem"},"nextItem":{"title":"FiveM Server Performance Optimization: Best Practices & Tips (2024 Guide)","permalink":"/blog/tutorials/fivem-server-optimization"}},"content":"Having trouble with FiveM? Clearing your cache might be the solution you\'re looking for. In this comprehensive guide, we\'ll walk you through every method to clear your FiveM cache effectively.\\n\\n## Quick Solution\\n1. Press Windows + R\\n2. Type `%localappdata%`\\n3. Find and delete the `FiveM` folder\\n4. Restart FiveM\\n\\n*Keep reading for detailed instructions and alternative methods.*\\n\\n## Table of Contents\\n- [Why Clear FiveM Cache?](#why-clear-fivem-cache)\\n- [Method 1: Clear Cache Through Windows Explorer](#method-1-clear-cache-through-windows-explorer)\\n- [Method 2: Using FiveM Cache Cleaner](#method-2-using-fivem-cache-cleaner)\\n- [Method 3: Clear Specific Cache Files](#method-3-clear-specific-cache-files)\\n- [Common Issues Fixed by Clearing Cache](#common-issues-fixed-by-clearing-cache)\\n- [Preventive Measures](#preventive-measures)\\n- [FAQs](#faqs)\\n\\n## Why Clear FiveM Cache?\\nClearing your FiveM cache can resolve numerous issues:\\n- Slow loading times\\n- Server connection problems\\n- Missing textures\\n- Game crashes\\n- Poor performance\\n- Script errors\\n- Outdated server files\\n\\n## Method 1: Clear Cache Through Windows Explorer\\nThis is the most common and effective method to clear your FiveM cache:\\n\\n1. **Close FiveM** completely\\n2. Press **Windows + R** to open Run dialog\\n3. Type `%localappdata%` and press Enter\\n4. Find the **FiveM folder**\\n5. Delete these specific folders:\\n    - `FiveM/FiveM.app/data/cache`\\n    - `FiveM/FiveM.app/data/server-cache`\\n    - `FiveM/FiveM.app/data/server-cache-priv`\\n6. **Restart** FiveM\\n\\n## Method 2: Using FiveM Cache Cleaner\\nFor those who prefer automated solutions:\\n\\n1. Download a trusted FiveM Cache Cleaner\\n2. Run the application as administrator\\n3. Select the cache types you want to clear\\n4. Click \\"Clear Cache\\"\\n5. Restart FiveM\\n\\n:::warning\\nOnly download cache cleaners from trusted sources to avoid malware.\\n:::\\n\\n## Method 3: Clear Specific Cache Files\\nFor advanced users who want more control:\\n\\n1. Navigate to `%localappdata%/FiveM/FiveM.app/data/`\\n2. Clear specific folders based on your issues:\\n    - `cache/` - General game cache\\n    - `server-cache/` - Server-specific files\\n    - `server-cache-priv/` - Private server data\\n    - `game-storage/` - Game storage data\\n\\n## Common Issues Fixed by Clearing Cache\\n\\n### 1. Infinite Loading Screen\\n- Delete the entire cache folder\\n- Clear server-cache specifically\\n- Verify game files after clearing\\n\\n### 2. Missing Textures\\n- Focus on clearing the `cache/` folder\\n- Remove shader cache files\\n- Reinstall graphics-heavy mods\\n\\n### 3. Server Connection Issues\\n- Clear `server-cache/` and `server-cache-priv/`\\n- Reset Discord integration cache\\n- Check server status after clearing\\n\\n## Preventive Measures\\n\\n1. **Regular Maintenance**\\n    - Clear cache monthly\\n    - Update FiveM regularly\\n    - Monitor storage space\\n\\n2. **Optimal Settings**\\n    - Limit cached files\\n    - Use recommended game settings\\n    - Keep Windows updated\\n\\n3. **Best Practices**\\n    - Don\'t join too many servers\\n    - Remove unused mods\\n    - Maintain free disk space\\n\\n## FAQs\\n\\n### How often should I clear FiveM cache?\\nClear your cache every 2-4 weeks or when experiencing issues. Regular players should clear more frequently.\\n\\n### Will clearing cache delete my settings?\\nNo, your personal settings and key bindings will remain intact. Only temporary files are removed.\\n\\n### Why does FiveM cache get corrupted?\\nCache corruption can occur from:\\n- Sudden game crashes\\n- Power outages\\n- Multiple server connections\\n- Mod conflicts\\n- Insufficient disk space\\n\\n### Can clearing cache fix FPS issues?\\nYes, clearing cache can improve FPS by removing unnecessary files and optimizing game performance.\\n\\n### Do I need to verify game files after clearing cache?\\nIt\'s not necessary but recommended if you continue experiencing issues after clearing cache.\\n\\n:::tip Pro Tip\\nCreate a backup of your FiveM folder before clearing cache if you have important custom files.\\n:::\\n\\n## Conclusion\\nClearing your FiveM cache is a simple yet effective way to resolve many common issues. Follow this guide regularly to maintain optimal performance and enjoy a smoother gaming experience.\\n\\n*Remember to backup any important files before clearing cache, and always follow the official FiveM guidelines for best results.*\\n\\n---\\n\\n**Last Updated**: November 2024  \\n**Author**: S1nScripts Documentation Team"},{"id":"/tutorials/fivem-server-optimization","metadata":{"permalink":"/blog/tutorials/fivem-server-optimization","source":"@site/blog/2024-10-22-server-perf-optimization.md","title":"FiveM Server Performance Optimization: Best Practices & Tips (2024 Guide)","description":"Learn how to optimize your FiveM server performance with our comprehensive guide covering best practices, configuration tips, and proven optimization techniques.","date":"2024-10-22T00:00:00.000Z","formattedDate":"October 22, 2024","tags":[],"readingTime":2.47,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"FiveM Server Performance Optimization: Best Practices & Tips (2024 Guide)","description":"Learn how to optimize your FiveM server performance with our comprehensive guide covering best practices, configuration tips, and proven optimization techniques.","keywords":["fivem optimization","server performance","fivem server","performance tips","fivem lag fix"],"slug":"/tutorials/fivem-server-optimization"},"unlisted":false,"prevItem":{"title":"FiveM: How to Clear Cache - Complete Guide (2024)","permalink":"/blog/tutorials/how-to-clear-fivem-cache"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"Running a smooth FiveM server requires careful optimization and regular maintenance. This comprehensive guide will walk you through proven techniques to enhance your server\'s performance and reduce lag.\\n\\n## Understanding Server Performance Metrics\\n\\nBefore diving into optimization, it\'s crucial to understand key performance indicators:\\n\\n- **Server tick rate**: Ideal range is 48-60ms\\n- **CPU usage**: Should stay below 80%\\n- **Memory consumption**: Monitor for memory leaks\\n- **Network latency**: Target < 100ms for optimal gameplay\\n\\n## Essential Server Configuration Tweaks\\n\\n### Basic server.cfg Optimization\\n\\n```lua\\n# Performance-related settings\\nset onesync on\\nset onesync_population false\\nset sv_enforceGameBuild 2944\\nset sv_clockSync true\\nset sv_scriptHookAllowed 0\\n\\n# Connection settings\\nsv_maxClients 48\\nset sv_endpointPrivacy true\\n\\n# Network optimization\\nsv_scriptHookAllowed 0\\nset sv_forceIndirectListing true\\n```\\n\\n### OneSync Configuration\\n\\nOneSync is crucial for server performance. Here\'s how to optimize it:\\n\\n1. Enable OneSync Legacy\\n2. Configure entity culling\\n3. Set proper population density\\n4. Adjust streaming range\\n\\n## Resource Management\\n\\n### Script Loading Order\\n\\nOptimize your resource loading sequence:\\n\\n1. Core framework resources\\n2. Database connections\\n3. Essential game mechanics\\n4. Optional features\\n5. Non-essential scripts\\n\\n### Resource Monitoring\\n\\n```lua\\n# Add to server.cfg\\nset game_enableTaskScheduler true\\nset game_enableOptimizedScheduler true\\n```\\n\\n## Database Optimization\\n\\n### MySQL Performance Tips\\n\\n1. Implement connection pooling\\n2. Use proper indexing\\n3. Regular database maintenance\\n4. Query optimization\\n\\n```sql\\n-- Example of an optimized query\\nSELECT * FROM players \\nWHERE last_seen > DATE_SUB(NOW(), INTERVAL 7 DAY)\\nINDEX(last_seen);\\n```\\n\\n## Common Performance Issues and Solutions\\n\\n### Script-Related Problems\\n\\n1. **Memory Leaks**\\n   - Monitor resource memory usage\\n   - Implement garbage collection\\n   - Regular server restarts\\n\\n2. **CPU Bottlenecks**\\n   - Identify heavy scripts\\n   - Implement async operations\\n   - Optimize loops and functions\\n\\n### Network Optimization\\n\\n```lua\\n-- Network configuration\\nsetr voice_useNativeAudio true\\nsetr voice_useSendingRangeOnly true\\nset sv_maxConcurrentResources 100\\n```\\n\\n## Advanced Optimization Techniques\\n\\n### Entity Management\\n\\n1. **Entity Culling**\\n   ```lua\\n   -- Add to your resource manifest\\n   lua54 \'yes\'\\n   game \'gta5\'\\n   fx_version \'cerulean\'\\n   ```\\n\\n2. **Stream Distance**\\n   ```lua\\n   -- Optimized streaming distance\\n   SetStreamDistance(500.0)\\n   ```\\n\\n### Performance Monitoring Tools\\n\\n1. **Server Monitoring**\\n   - txAdmin dashboard\\n   - Resource monitor\\n   - Network statistics\\n\\n2. **Diagnostic Tools**\\n   - FiveM debug console\\n   - Performance profiler\\n   - Memory snapshots\\n\\n## Best Practices for Long-Term Performance\\n\\n1. Regular maintenance schedule\\n2. Backup system implementation\\n3. Update management strategy\\n4. Resource audit process\\n\\n## Performance Testing\\n\\n### Stress Testing Protocol\\n\\n1. Simulate player load\\n2. Monitor resource usage\\n3. Check for memory leaks\\n4. Verify network stability\\n\\n## Optimization Checklist\\n\\n\u2713 Server configuration review  \\n\u2713 Resource audit  \\n\u2713 Database optimization  \\n\u2713 Network settings  \\n\u2713 Entity management  \\n\u2713 Monitoring tools setup  \\n\\n## Conclusion\\n\\nOptimizing your FiveM server is an ongoing process that requires regular attention and maintenance. By following these best practices and implementing the suggested optimizations, you can significantly improve your server\'s performance and player experience.\\n\\n### Additional Resources\\n\\n- [Official FiveM Documentation](https://docs.fivem.net/)\\n- [Community Forums](https://forum.cfx.re/)\\n- [Performance Monitoring Tools](https://your-store-link)\\n\\n---\\n\\n*Need professional scripts optimized for performance? Check out our [premium FiveM scripts](your-store-link) designed for maximum efficiency.*"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","formattedDate":"August 26, 2021","tags":[{"label":"facebook","permalink":"/blog/tags/facebook"},{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"S\xe9bastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","imageURL":"https://github.com/slorber.png","key":"slorber"},{"name":"Yangshun Tay","title":"Front End Engineer @ Facebook","url":"https://github.com/yangshun","imageURL":"https://github.com/yangshun.png","key":"yangshun"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["slorber","yangshun"],"tags":["facebook","hello","docusaurus"]},"unlisted":false,"prevItem":{"title":"FiveM Server Performance Optimization: Best Practices & Tips (2024 Guide)","permalink":"/blog/tutorials/fivem-server-optimization"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."}]}')}}]);